import React, {Component} from 'react';
import './App.css';

class App extends Component {
    render() {
        return (
            <React.Fragment>
                <header>
                    <h1>Hello, this is Lica`s movie app</h1>
                </header>

            </React.Fragment>
        );
    }
}

export default App;
